import Head from 'next/head';
import { useState, useEffect } from 'react';

export default function HomePage() {
  const [serverUrl, setServerUrl] = useState('');

  useEffect(() => {
    setServerUrl(window.location.origin);
  }, []);

  const openapi = {
    openapi: '3.0.0',
    info: {
      title: 'File Operations API',
      description: 'API for reading, updating, and deleting files.',
      version: '1.0.0'
    },
    // 他の仕様をここに追加
  };

  return (
    <div className='container mx-auto px-4'>
      <Head>
        <title>File Operations API Documentation</title>
      </Head>

      <h1 className='text-3xl font-bold underline my-4'>File Operations API</h1>
      <pre className='bg-gray-100 p-4 rounded'>{JSON.stringify(openapi, null, 2)}</pre>
    </div>
  );
}
